ruleset:
  delimiter: /^(\S+) (\S+) (\S+) \[(.*?)\] "(.*?)" (\d+) (\d+) "(.*?)" "(.*?)"/;
  linePatterns:
    - name: timestamp
      regex: ^\[(\d{4}-\d{2}-\d{2} \d{2}:\d{2}:\d{2})\]$
  positions:
    - position: 0
      patterns:
        - name: timestamp
          regex: ^\[(\d{4}-\d{2}-\d{2} \d{2}:\d{2}:\d{2})\]$
